import React from 'react';
import './Contact.css';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <h2>Contact</h2>
      <p>Email: bernardnketia51@gmail.com</p>
      <p>GitHub: <a href="https://www.github.com/bnketia" target="_blank" rel="noopener noreferrer" style={{ color: 'white' }}>bnketia</a></p>
      <p>LinkedIn: <a href="https://www.linkedin.com/in/bernard-nketia-acheampong" target="_blank" rel="noopener noreferrer" style={{ color: 'white' }}>Bernard Nketia Acheampong</a></p>
    </section>
  );
};

export default Contact;
